import './App.css';
import TimeSeetTable from './TimeSeetTable';


function App() { 
  return (
    <div className="container">
      <div className="App">
        <h1>Учет отсутствия сотрудников на рабочем месте</h1>
        <TimeSeetTable/>
      </div>
    </div>
  );
}

export default App;
